import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

function Operations() {
  return (
    <StyledContainer>
      <Subnavigation title='Insights B'>
        <SubnavItem to='app'>My App</SubnavItem>
        <SubnavItem to='assets' indent>Assets</SubnavItem>
        <SubnavItem to='cache' indent>Cache</SubnavItem>
        <SubnavItem to='crons' indent>Crons</SubnavItem>
        <SubnavItem to='queries' indent>Queries</SubnavItem>
        <SubnavItem to='queues' indent>Queues</SubnavItem>
        <SubnavItem to='requests' indent>Requests</SubnavItem>
        <SubnavItem to='ui' indent>UI</SubnavItem>
        <SubnavItem to='uptime' indent>Uptime</SubnavItem>
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Operations;
